  subroutine actual_rhs(state, ydot)
    
    !$acc routine seq

    use extern_probin_module, only: do_constant_volume_burn, disable_thermal_neutrinos
    use burn_type_module, only: net_itemp, net_ienuc, neqs
    use sneut_module, only: sneut5
    use temperature_integration_module, only: temperature_rhs

    implicit none

    type(burn_t), intent(in) :: state
    real(rt), intent(inout) :: ydot(neqs)

    type(rate_eval_t) :: rate_eval
    real(rt) :: Y(nspec), ydot_nuc(nspec)
    integer :: i, j
    real(rt) :: rhoy, ye, enuc
    real(rt) :: sneut, dsneutdt, dsneutdd, snuda, snudz

    !$gpu

    ! Set molar abundances
    Y(:) = state % xn(:) * aion_inv(:)

    call evaluate_rates(state, rate_eval)

    call rhs_nuc(state, ydot_nuc, Y, rate_eval % screened_rates)
    ydot(1:nspec) = ydot_nuc

    ! ion binding energy contributions
    call ener_gener_rate(ydot_nuc, enuc)

    ! include reaction neutrino losses (non-thermal)

    ! Get the thermal neutrino losses
    if (.not. disable_thermal_neutrinos) then
       call sneut5(state % T, state % rho, state % abar, state % zbar, sneut, dsneutdt, dsneutdd, snuda, snudz)
    else
       sneut = ZERO
    end if

    ! Append the energy equation (this is erg/g/s)
    ydot(net_ienuc) = enuc - sneut

    ! Append the temperature equation
    call temperature_rhs(state, ydot)

  end subroutine actual_rhs


  subroutine rhs_nuc(state, ydot_nuc, Y, screened_rates)

    !$acc routine seq

    implicit none

    type (burn_t), intent(in) :: state
    real(rt), intent(out) :: ydot_nuc(nspec)
    real(rt), intent(in)  :: Y(nspec)
    real(rt), intent(in)  :: screened_rates(nrates)

    !$gpu



    ydot_nuc(jn) = ( &
      screened_rates(k_al26__n_al25)*Y(jal26) + screened_rates(k_al27__n_al26)*Y(jal27) + &
      screened_rates(k_ar37__n_ar36)*Y(jar37) + screened_rates(k_ar38__n_ar37)* &
      Y(jar38) + screened_rates(k_ar39__n_ar38)*Y(jar39) + &
      screened_rates(k_ar40__n_ar39)*Y(jar40) + screened_rates(k_b11__n_b10)*Y(jb11) &
      + screened_rates(k_be9__n_he4_he4)*Y(jbe9) + 0.5e0_rt* &
      screened_rates(k_c12_c12__n_mg23)*Y(jc12)**2*state % rho + &
      screened_rates(k_c13__n_c12)*Y(jc13) + screened_rates(k_c14__n_c13)*Y(jc14) + &
      screened_rates(k_ca41__n_ca40)*Y(jca41) + screened_rates(k_ca42__n_ca41)* &
      Y(jca42) + screened_rates(k_ca43__n_ca42)*Y(jca43) + &
      screened_rates(k_ca44__n_ca43)*Y(jca44) + screened_rates(k_ca45__n_ca44)* &
      Y(jca45) + screened_rates(k_ca46__n_ca45)*Y(jca46) + &
      screened_rates(k_ca47__n_ca46)*Y(jca47) + screened_rates(k_ca48__n_ca47)* &
      Y(jca48) + screened_rates(k_cl34__n_cl33)*Y(jcl34) + &
      screened_rates(k_cl35__n_cl34)*Y(jcl35) + screened_rates(k_cl36__n_cl35)* &
      Y(jcl36) + screened_rates(k_cl37__n_cl36)*Y(jcl37) + &
      screened_rates(k_co54__n_co53)*Y(jco54) + screened_rates(k_co55__n_co54)* &
      Y(jco55) + screened_rates(k_co56__n_co55)*Y(jco56) + &
      screened_rates(k_co57__n_co56)*Y(jco57) + screened_rates(k_co58__n_co57)* &
      Y(jco58) + screened_rates(k_co59__n_co58)*Y(jco59) + &
      screened_rates(k_cr49__n_cr48)*Y(jcr49) + screened_rates(k_cr50__n_cr49)* &
      Y(jcr50) + screened_rates(k_cr51__n_cr50)*Y(jcr51) + &
      screened_rates(k_cr52__n_cr51)*Y(jcr52) + screened_rates(k_cr53__n_cr52)* &
      Y(jcr53) + screened_rates(k_cr54__n_cr53)*Y(jcr54) + &
      screened_rates(k_cu58__n_cu57)*Y(jcu58) + screened_rates(k_cu59__n_cu58)* &
      Y(jcu59) + screened_rates(k_cu60__n_cu59)*Y(jcu60) + &
      screened_rates(k_cu61__n_cu60)*Y(jcu61) + screened_rates(k_cu62__n_cu61)* &
      Y(jcu62) + screened_rates(k_cu63__n_cu62)*Y(jcu63) + &
      screened_rates(k_cu64__n_cu63)*Y(jcu64) + screened_rates(k_cu65__n_cu64)* &
      Y(jcu65) + screened_rates(k_d__n_p)*Y(jd) + screened_rates(k_d_c13__n_n14)* &
