      screened_rates(k_n_be7__he4_he4)*Y(jbe7)*state % rho - &
      screened_rates(k_n_be7__p_li7)*Y(jbe7)*state % rho - screened_rates(k_n_c12__c13)* &
      Y(jc12)*state % rho - screened_rates(k_n_c12__he4_be9)*Y(jc12)*state % rho - &
      screened_rates(k_n_c13__c14)*Y(jc13)*state % rho - screened_rates(k_n_ca40__ca41)* &
      Y(jca40)*state % rho - screened_rates(k_n_ca40__he4_ar37)*Y(jca40)* &
      state % rho - screened_rates(k_n_ca40__p_k40)*Y(jca40)*state % rho - &
      screened_rates(k_n_ca41__ca42)*Y(jca41)*state % rho - &
