      screened_rates(k_n_ge64__he4_zn61)*Y(jn)*state % rho - &
      screened_rates(k_n_ge64__p_ga64)*Y(jn)*state % rho &
       )
    call set_jac_entry(jac, jge64, jge64, scratch)


  end subroutine jac_nuc

end module actual_rhs_module
